import React, { Component } from 'react';
import './App.css';

class App extends Component {
  render() {
    return (
      <div className="App">
        <header>
            <img src="https://www.koreanfilm.or.kr/timthumb.php?src=http://mn.kobiz.or.kr/upload/up_etc/2019/01/2010420190129145532.jpg&w=190&h=200&zc=0" />
          </header>
      </div>
    );
  }
}

export default App;
